	            "calendarHelp": "- ລູກ​ສອນ​ຂຶ້ນ​ແລະ​ລູກ​ສອນ​ລົງ - ໄປ​ໃນ​ມື້​ດຽວ​ກັນ​ຂອງ​ອາ​ທິດ​ໃນ​ອາ​ທິດ​ທີ່​ຜ່ານ​ມາ​ຫຼື​ຕໍ່​ໄປ​ຕາມ​ລໍາ​ດັບ​. ຖ້າ​ຫາກ​ວ່າ​ໃນ​ຕອນ​ທ້າຍ​ຂອງ​ເດືອນ​ນັ້ນ​ແມ່ນ​ບັນ​ລຸ​ໄດ້​, ຍັງ​ຈະ​ສືບ​ຕໍ່​ເຂົ້າ​ໄປ​ໃນ​ເດືອນ​ຕໍ່​ໄປ​ຫຼື​ກ່ອນ​ຫນ້າ​ຕາມ​ຄວາມ​ເຫມາະ​ສົມ​.\r\n- ລູກ​ສອນ​ຊ້າຍ​ແລະ​ລູກ​ສອນ​ສິດ - ຄວາມ​ກ້າວ​ຫນ້າ​ຂອງ​ມື້​ຫນຶ່ງ​ກັບ​ການ​ຕໍ່​ໄປ​, ຍັງ​ຢູ່​ໃນ​ການ​ຕໍ່​ເນື່ອງ​ໄດ້​. ຈຸດ​ສຸມ​ສາຍ​ຕາ​ໄດ້​ຖືກ​ຍ້າຍ​ຈາກ​ລະ​ມື້​ລະ​ວັນ​ແລະ wraps ຈາກ​ຕິດ​ຕໍ່​ກັນ​ຕິດ​ຕໍ່​ກັນ​ໃນ​ຕາ​ຂ່າຍ​ໄຟ​ຟ້າ​ຂອງ​ມື້​ໄດ້​.\r\n- ການ​ຄວບ​ຄຸມ + ຫນ້າ Up - ຍ້າຍ​ໄປ​ໃນ​ວັນ​ທີ​ທີ່​ດຽວ​ກັນ​ໃນ​ປີ​ທີ່​ຜ່ານ​ມາ​.\r\n- ການ​ຄວບ​ຄຸມ + ຫນ້າ​ລົງ - ຍ້າຍ​ໄປ​ໃນ​ວັນ​ທີ​ທີ່​ດຽວ​ກັນ​ໃນ​ປີ​ຕໍ່​ໄປ​.\r\n- ຫນ້າ​ທໍາ​ອິດ - ການ​ເຄື່ອນ​ໄຫວ​ໄປ​ໃນ​ມື້​ທໍາ​ອິດ​ຂອງ​ເດືອນ​ໃນ​ປະ​ຈຸ​ບັນ​.\r\n- ສຸດ​ທ້າຍ - ການ​ເຄື່ອນ​ໄຫວ​ໄປ​ມື້​ສຸດ​ທ້າຍ​ຂອງ​ເດືອນ​ໃນ​ປະ​ຈຸ​ບັນ​.\r\n- ຫນ້າ Up - ການ​ເຄື່ອນ​ໄຫວ​ໃນ​ວັນ​ດຽວ​ກັນ​ໃນ​ເດືອນ​ທີ່​ຜ່ານ​ມາ​.\r\n- ຫນ້າ​ລົງ - ການ​ເຄື່ອນ​ໄຫວ​ໃນ​ວັນ​ດຽວ​ກັນ​ໃນ​ເດືອນ​ຕໍ່​ໄປ​.\r\n- ກະ​ລຸ​ນາ​ໃສ່​ຫຼື Espace - ກັບ​ການ​ປະ​ຕິ​ທິນ​, ແລະ​ວັນ​ທີ​ທີ່​ການ​ຄັດ​ເລືອກ​ສະ​ແດງ​ໃຫ້​ເຫັນ​ໃນ​ກ່ອງ​ຂໍ້​ຄວາມ​ທີ່​ກ່ຽວ​ຂ້ອງ​.\r\n- Escape - ກັບ​ການ​ປະ​ຕິ​ທິນ​ໂດຍ​ບໍ່​ມີ​ການ​ດໍາ​ເນີນ​ການ​ໃດໆ​ໄດ້​."
