	            "calendarHelp": "- அம்பு மற்றும் அம்பு - முறையே முந்தைய அல்லது அடுத்த வாரம் வாரம் அதே நாள் செல்கிறது. மாத இறுதியில் அடைந்தது, பொருத்தமான அடுத்த அல்லது முந்தைய மாதம் தொடர்கிறது.\r\n- இடது அம்பு மற்றும் வலது அம்பு - மேலும் ஒரு தொடர்ச்சி, அடுத்த ஒரு நாள் முன்னெடுக்கிறது. பார்வை கவனம் நாளுக்குநாள் சென்றார் மற்றும் நாட்கள் கட்டம் வரிசை வரிசையில் இருந்து மறைப்புகள்.\r\n- கண்ட்ரோல் + பக்கம் அப் - முந்தைய ஆண்டில் அதே தேதியில் நகரும்.\r\n- கண்ட்ரோல் + டவுன் பக்கம் - அடுத்த ஆண்டு அதே தேதி நகர்வுகள்.\r\n- முகப்பு - தற்போதைய மாதம் முதல் நாள் நகரும்.\r\n- முடிவு - நடப்பு மாதம் கடைசி நாள் நகர்வுகள்.\r\n- பக்கம் அப் - முந்தைய மாதத்தில் அதே தேதியில் நகரும்.\r\n- டவுன் பக்கம் - அடுத்த மாதம் அதே தேதியில் நகரும்.\r\n- உள்ளிடவும் அல்லது ஈஸ்பேஸ் - காலண்டர் மூடி, மற்றும் தேர்வு தேதி தொடர்புடைய உரை பெட்டியில் காட்டப்பட்டுள்ளது.\r\n- எஸ்கேப் - எந்த நடவடிக்கையும் இல்லாமல் காலண்டர் நிறைவடைகிறது."
