	            "calendarHelp": "- బాణం మరియు డౌన్ బాణం - వరుసగా మునుపటి లేదా తదుపరి వారం వారం అదే రోజు వెళుతుంది. నెల చివరిలో చేరుకుంది ఉంటుంది, తగిన తదుపరి లేదా మునుపటి నెల వరకు కొనసాగుతుంది.\r\n- ఎడమ బాణం మరియు కుడి బాణం - ఒక క్రమణిక లో వచ్చే ఒక రోజు పురోగమిస్తుంది. దృశ్యపరంగా దృష్టి రోజు రోజు కు తరలించబడింది మరియు రోజుల గ్రిడ్లో వరుస వరుసగా నుండి మూటగట్టి ఉంది.\r\n- కంట్రోల్ + Page Up - గత ఏడాది ఇదే తేదీ మూవ్స్.\r\n- కంట్రోల్ + Page Down - తరువాతి ఏడాది ఇదే తేదీ మూవ్స్.\r\n- Home - ప్రస్తుత నెల మొదటి రోజు చేరుకుంటాడు.\r\n- ఎండ్ - ప్రస్తుత నెలలో చివరి రోజు చేరుకుంటాడు.\r\n- Page Up - గత నెలలో అదే తేదీ మూవ్స్.\r\n- పేజీ డౌన్ - వచ్చే నెల లో అదే తేదీ మూవ్స్.\r\n- Enter లేదా ఈస్పేస్ - క్యాలెండర్ ముగుస్తాయి, మరియు ఎంచుకున్న తేదీ సంబంధించిన టెక్స్ట్ బాక్స్ లో చూపించాం.\r\n- ఎస్కేప్ - ఏ చర్య లేకుండా క్యాలెండర్ ముగుస్తాయి."
